(16, 114, 'Feed Display', 'feed-display', '<p>This module allows the displaying of a syndicated feed. <a href=\"https://help.joomla.org/proxy/index.php?keyref=Help31:Extensions_Module_Manager_Feed_Display\" title=\"Feed Display Module\">Help</a></p><div class=\"sample-module\">{loadmodule feed,Feed Display}</div>', '', 1, 66, '2017-09-05 18:29:03', 852, 'Joomla', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2017-09-05 18:29:03', '0000-00-00 00:00:00', '', '', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_readmore\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_hits\":\"\",\"page_title\":\"\",\"alternative_readmore\":\"\",\"layout\":\"\"}', 1, 2, '', '', 1, 0, '', 0, '*', ''),
