(10061, 0, 'Ja_Social_II', 'template', 'ja_social_ii', '', 0, 1, 1, 0, '{\"name\":\"Ja_Social_II\",\"type\":\"template\",\"creationDate\":\"22 November 2016\",\"author\":\"JoomlArt.com\",\"copyright\":\"Copyright (C), J.O.O.M Solutions Co., Ltd. All Rights Reserved.\",\"authorEmail\":\"webmaster@joomlart.com\",\"authorUrl\":\"http:\\/\\/www.t3-framework.org\",\"version\":\"1.0.6\",\"description\":\"\\n\\t\\t\\n\\t\\t<div align=\\\"center\\\">\\n\\t\\t\\t<div class=\\\"alert alert-success\\\" style=\\\"background-color:#DFF0D8;border-color:#D6E9C6;color: #468847;padding: 1px 0;\\\">\\n\\t\\t\\t\\t<h3><a href=\\\"http:\\/\\/www.joomlart.com\\/joomla\\/templates\\/ja-social-ii\\\">Responsive Joomla social template - JA Social II<\\/a><\\/h3>\\n\\t\\t\\t\\t<h4><a href=\\\"http:\\/\\/ja-social-ii.demo.joomlart.com\\/\\\" title=\\\"\\\">Demo<\\/a> | <a href=\\\"http:\\/\\/www.joomlart.com\\/documentation\\/joomla-templates\\/ja-social-ii\\\" title=\\\"\\\">Document<\\/a> | <a href=\\\"http:\\/\\/pm.joomlart.com\\/browse\\/JASOCIALII\\\" title=\\\"\\\">Changelog<\\/a><\\/h4>\\n\\t\\t\\t\\t<p>JA Social II is all new responsive Joomla template to build a social network for your community. Social II derives its name from JA Social I, one of our best Joomla social template for years. Social II is designed to help you create your own social network with Joomla. <\\/p>\\n\\t\\t\\t\\t<p>Support both of the best Joomla extensions for social networks JomSocial, EasySocial. JA Social II is the ultimate ingredient for a successful community project. You can build a full fledged social media site with both style and functionality.<\\/p>\\n\\t\\t\\t\\t<p>Moreover, JA Social II is not only a social media Joomla template but also a multipurpose responsive Joomla template. The template\'s custom styles and layouts allow you to create a beautiful layout with the power of JoomlArt Advanced Custom Modules extension. JA Social II also features Joomla blogging component - K2.<\\/p>\\n\\t\\t\\t\\t<p>With T3 Framework and Bootstrap 3 at core, JA Social II is friendly and easy to customize. You can freely design the responsive Joomla template with MagicTheme, and Layout Configuration.<\\/p>\\n\\t\\t\\t\\t<p>JA Social II supports RTL language layouts.<\\/p>\\n\\t\\t\\t\\t<span style=\\\"color:#FF0000\\\">Note: T3 blank requires T3 plugin to be installed and enabled.<\\/span><p><\\/p>\\n\\t\\t\\t\\t<p>Copyright 2004 - 2016 <a href=\'http:\\/\\/www.joomlart.com\\/\' title=\'Visit Joomlart.com!\'>JoomlArt.com<\\/a>.<\\/p>\\n\\t\\t\\t<\\/div>\\n\\t\\t\\t<style>table.adminform{width: 100%;}<\\/style>\\n\\t\\t<\\/div>\\n\\t\\t\\n\\t\",\"group\":\"\",\"filename\":\"templateDetails\"}', '{\"logolink\":\"default\",\"logolink_id\":\"\",\"bodybackground\":\"image\",\"bodybackgroundimage\":\"\"}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
