(100, 330, 'About Us', '', '<div class=\"row\" id=\"aboutus\"></br>\r\n	<div class=\"col-xs-12 col-md-5\">\r\n		<p>It will be a pleasure serving you. Our attempt through this initiative is to offer you exemplary service and convenience of online local services without having to visit the crowded supermarkets, hotels, spa and salons. \r\nWe are currently in the beta phase, which means we are still perfecting our systems. However, in no way we are compromising on our promises to you. It just means that we have restricted our grocery deliveries to selected localities of “Pune” and will only be serving in these localities for the time being. Your feedback and suggestions, during this phase will be most valuable to us and will help us to live up your expectations. So whether we delighted you or have let you down, give us a shout.</p>\r\n		<div class=\"vertical-space2\"></div>\r\n	</div>\r\n</div>', 1, 'showcase-1', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(101, 331, 'CONTACT US', '', '<div class=\"row main-contact-block-horizontal\">\r\n\r\n	<div class=\"col-md-4 col-sm-4 contact-block-horizontal\">\r\n	<a href=\"#!\">\r\n		<div class=\"icon\">\r\n			<i class=\"fa fa-mobile\"></i>\r\n		</div>\r\n		<div class=\"content\">\r\n			<div class=\"content-inner\">\r\n				<div class=\"arrow\"></div>\r\n				<h3>Phone</h3>\r\n				<p>+91 9960665111</p>\r\n			</div>\r\n		</div>\r\n	</a>\r\n	</div>\r\n	\r\n	<div class=\"col-md-4 col-sm-4 contact-block-horizontal\">\r\n	<a href=\"#!\">\r\n		<div class=\"icon\">\r\n			<i class=\"fa fa-envelope\"></i>\r\n		</div>\r\n		<div class=\"content\">\r\n			<div class=\"content-inner\">\r\n				<div class=\"arrow\"></div>\r\n				<h3>E-mail</h3>\r\n				<p>info@motleymart.com</p>\r\n			</div>\r\n		</div>\r\n	</a>\r\n	</div>\r\n\r\n	<div class=\"col-md-4 col-sm-4 contact-block-horizontal\">\r\n	<a href=\"#!\">\r\n		<div class=\"icon\">\r\n			<i class=\"fa fa-map-marker\"></i>\r\n		</div>\r\n		<div class=\"content\">\r\n			<div class=\"content-inner\">\r\n				<div class=\"arrow\"></div>\r\n				<h3>Address</h3>\r\n				<p>23/172/6,<br>Sawali Society,<br>Ichalkaranji 416115</p>\r\n			</div>\r\n		</div>\r\n	</a>\r\n	</div>\r\n</div>', 1, 'addressbarbottom', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(102, 332, 'SERVICES', '', '<div class=\"center box-circle\">\r\n	<div class=\"vertical-space2\"></div>\r\n	<div class=\"row\">\r\n      \r\n		<div class=\"col-md-3\">\r\n			<div class=\"vertical-space2\"></div>\r\n			<a href=\"#!\">\r\n				<div class=\"icon-box-icon\">\r\n					<i class=\"fa fa-cart-plus\" aria-hidden=\"true\"></i>\r\n				</div>\r\n			</a>\r\n			<div class=\"box-content\">\r\n				<h3>Grocery</h3>\r\n				<p>Available on Motley</p>\r\n			</div>\r\n			<div class=\"vertical-space2\"></div>\r\n		</div>\r\n  \r\n		<div class=\"col-md-3\">\r\n			<div class=\"vertical-space2\"></div>\r\n			<a href=\"#!\">\r\n				<div class=\"icon-box-icon\">\r\n					<i class=\"fa fa-eye\" aria-hidden=\"true\"></i>\r\n				</div>\r\n			</a>\r\n			<div class=\"box-content\">\r\n				<h3>Beauty</h3>\r\n				<p>Comming Soon</p>\r\n			</div>\r\n			<div class=\"vertical-space2\"></div>\r\n		</div>\r\n		<div class=\"col-md-3\">\r\n			<div class=\"vertical-space2\"></div>\r\n			<a href=\"#!\">\r\n				<div class=\"icon-box-icon\">\r\n					<i class=\"fa fa-home\" aria-hidden=\"true\"></i>\r\n				</div>\r\n			</a>\r\n			<div class=\"box-content\">\r\n				<h3>Home Maintanance</h3>\r\n				<p>Comming Soon</p>\r\n			</div>\r\n			<div class=\"vertical-space2\"></div>\r\n		</div>\r\n		<div class=\"col-md-3\">\r\n			<div class=\"vertical-space2\"></div>\r\n			<a href=\"#!\">\r\n				<div class=\"icon-box-icon\">\r\n					<i class=\"fa fa-cutlery\" aria-hidden=\"true\"></i>\r\n				</div>\r\n			</a>\r\n			<div class=\"box-content\">\r\n				<h3>Food Dilevery</h3>\r\n				<p>Comming Soon</p>\r\n			</div>\r\n			<div class=\"vertical-space2\"></div>\r\n		</div>\r\n      \r\n     \r\n      \r\n      \r\n      \r\n      \r\n	</div>\r\n	<div class=\"vertical-space2\"></div>\r\n</div>\r\n<div class=\"center\"><a href=\"#!\" class=\"btn btn-primary\">Get in Touch</a></div>', 1, 'feature-1', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":\"