(103, 333, 'HOW IT WORKS', '', '<div class=\"container\">\r\n <h3 class=\"sp-module-title\">HOW IT WORKS</h3>\r\n<div class=\"center box-circle\">\r\n	<div class=\"vertical-space2\"></div>\r\n	<div class=\"row\">\r\n      	\r\n		<div class=\"col-md-4\">\r\n			<div class=\"vertical-space2\"></div>\r\n			<a href=\"#!\">\r\n              <img src=\"http://motleymart.com/images/HowItWorks/01.png\">\r\n				<!--<div class=\"icon-box-icon\">\r\n					<i class=\"fa fa-cart-plus\" aria-hidden=\"true\"></i>\r\n				</div> -->\r\n			</a>\r\n			<div class=\"box-content\">\r\n				<p>We Understand Your Needs</p>\r\n			</div>\r\n			<div class=\"vertical-space2\"></div>\r\n		</div>\r\n  \r\n		<div class=\"col-md-4\">\r\n			<div class=\"vertical-space2\"></div>\r\n			<a href=\"#!\">\r\n              <img src=\"http://motleymart.com/images/HowItWorks/02.png\">\r\n				<!--<div class=\"icon-box-icon\">\r\n					<i class=\"fa fa-eye\" aria-hidden=\"true\"></i>\r\n				</div> -->\r\n			</a>\r\n			<div class=\"box-content\">\r\n				\r\n				<p>A wide variety of categories</p>\r\n			</div>\r\n			<div class=\"vertical-space2\"></div>\r\n		</div>\r\n		<div class=\"col-md-4\">\r\n			<div class=\"vertical-space2\"></div>\r\n			<a href=\"#!\">\r\n              \r\n              <img src=\"http://motleymart.com/images/HowItWorks/03.png\">\r\n              \r\n				<!--<div class=\"icon-box-icon\">\r\n					<i class=\"fa fa-home\" aria-hidden=\"true\"></i>\r\n				</div> -->\r\n			</a> \r\n			<div class=\"box-content\">\r\n				<p>Easy Access To All Categories</p>\r\n			</div>\r\n			<div class=\"vertical-space2\"></div>\r\n		</div>\r\n		<div class=\"col-md-4\">\r\n			<div class=\"vertical-space2\"></div>\r\n			<a href=\"#!\">\r\n              <img src=\"http://motleymart.com/images/HowItWorks/04.png\">\r\n				<!--<div class=\"icon-box-icon\">\r\n					<i class=\"fa fa-cutlery\" aria-hidden=\"true\"></i>\r\n				</div>-->\r\n			</a>\r\n			<div class=\"box-content\">\r\n				\r\n				<p>Variety Of Products</p>\r\n			</div>\r\n			<div class=\"vertical-space2\"></div>\r\n		</div>\r\n      \r\n      <div class=\"col-md-4\">\r\n			<div class=\"vertical-space2\"></div>\r\n			<a href=\"#!\">\r\n              <img src=\"http://motleymart.com/images/HowItWorks/05.png\">\r\n				<!--<div class=\"icon-box-icon\">\r\n					<i class=\"fa fa-cutlery\" aria-hidden=\"true\"></i>\r\n				</div>-->\r\n			</a>\r\n			<div class=\"box-content\">\r\n				\r\n				<p>Your Cart</p>\r\n			</div>\r\n			<div class=\"vertical-space2\"></div>\r\n		</div>\r\n      \r\n      <div class=\"col-md-4\">\r\n			<div class=\"vertical-space2\"></div>\r\n			<a href=\"#!\">\r\n              <img src=\"http://motleymart.com/images/HowItWorks/06.png\">\r\n				<!--<div class=\"icon-box-icon\">\r\n					<i class=\"fa fa-cutlery\" aria-hidden=\"true\"></i>\r\n				</div>-->\r\n			</a>\r\n			<div class=\"box-content\">\r\n				\r\n				<p>Easy Payment Options</p>\r\n			</div>\r\n			<div class=\"vertical-space2\"></div>\r\n		</div>\r\n      \r\n     \r\n      \r\n      \r\n      \r\n      \r\n	</div>\r\n	<div class=\"vertical-space2\"></div>\r\n</div>\r\n  <div class=\"center\"><a href=\"#!\" class=\"btn btn-primary\">Get in Touch</a></div></divdiv>', 1, 'utility-1', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"System-rounded\"}', 0, '*'),
