(9, 49, 1, 15, 16, 1, 'rockettheme', 'com_weblinks', 'RocketTheme', 'rockettheme', '', '<div class=\"gantry-left\">\r\n    <p><img alt=\"RocketTheme WebLinks\" src=\"images/gantry/rockettheme_122x95.png\" /></p>\r\n</div>\r\n\r\n<p>RocketTheme is the author of the Gantry Framework and provides Premium Professional Themes and Templates, based on Gantry, for OpenSource Platforms: Joomla, Wordpress, phpBB3, Magento &amp; More</p>\r\n\r\n<p class=\"hidden-tablet hidden-phone\">The RocketTheme Template Club features exclusive access to professional templates to help transform your site &amp; set you apart from the competition.</p>', -2, 0, '0000-00-00 00:00:00', 1, '{\"category_layout\":\"\",\"image\":\"\"}', '', '', '{\"author\":\"\",\"robots\":\"\"}', 569, '2012-08-20 15:16:02', 833, '2012-08-20 15:56:35', 0, '*', 1),
