(9, 45, 'Joomla Video Tutorials ', 'getting-started-with-joomla-video-tutorials', '<p>If you\'re just getting started with Joomla, we\'ve created a 16-part video tutorial series guiding you through the basics of launching and building your site. You can pause, rewind, skip ahead and learn many core Joomla features in just about an hour.&nbsp;<a href=\"http://www.cloudaccess.net/joomla-knowledgebase/138-joomla-3-1/getting-started.html\" target=\"_blank\"><br /></a></p>\r\n<p>Each video covers an important section of the Joomla developmnent process. We recommend you start here when beginning to learn how to use Joomla.&nbsp;</p>\r\n<p><a href=\"http://www.cloudaccess.net/joomla-knowledgebase/138-joomla-3-1/getting-started.html\" target=\"_blank\" class=\"btn btn-primary\">Getting Started with Joomla</a></p>', '', 1, 8, '2012-08-20 15:06:29', 569, '', '2015-06-17 20:10:36', 569, 0, '0000-00-00 00:00:00', '2012-08-20 15:06:29', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"sh