(6, 12, 'Comprehensive Knowledgebase', 'comprehensive-knowledgebase', 'http://www.cloudaccess.net/training/tutorials.html', '<p>We\'ve got a knowledgebase full of hundreds of how-to documents and videos to help you get the most from your Joomla site.&nbsp;</p>', 10, 1, 0, '0000-00-00 00:00:00', 3, 1, '{\"target\":\"\",\"width\":\"\",\"height\":\"\",\"count_clicks\":\"\"}', '*', '2014-11-20 18:52:36', 570, '', '2014-11-20 19:02:30', 570, '', '', '{\"robots\":\"\",\"rights\":\"\"}', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 2, '{\"image_first\":\"\",\"float_first\":\"\",\"image_first_alt\":\"\",\"image_first_caption\":\"\",\"image_second\":\"\",\"float_second\":\"\",\"image_second_alt\":\"\",\"image_second_caption\":\"\"}'),
(7, 12, 'Watch a Joomla! Webinar', 'watch-a-joomla-webinar', 'http://www.cloudaccess.net/training/live-webinars.html', '<p>We\'ve got dozens of recorded webinars and we host free &amp; live webinars where you can post questions and get answers.&nbsp;</p>', 14, 1, 0, '0000-00-00 00:00:00', 4, 1, '{\"target\":\"\",\"width\":\"\",\"height\":\"\",\"count_clicks\":\"\"}', '*', '2014-11-20 18:53:41', 570, '', '2014-11-20 19:02:30', 570, '', '', '{\"robots\":\"\",\"rights\":\"\"}', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, '{\"image_first\":\"\",\"float_first\":\"\",\"image_first_alt\":\"\",\"image_first_caption\":\"\",\"image_second\":\"\",\"float_second\":\"\",\"image_second_alt\":\"\",\"image_second_caption\":\"\"}'),
