(88, 0, 'Frontpage Showcase', '', '<div class=\"promo-image\">\r\n<img src=\"images/gantryrocket.png\"/>\r\n</div>\r\n<div class=\"promo-desc\">\r\n<h1><b>What is Gantry?</b></h1>\r\n<p><b>Gantry</b> is a comprehensive set of <b>building blocks to enable the rapid development</b> and <b>realization of a design into a flexible</b> and <b>powerful web platform theme.</b></p>\r\n<a href=\"http://www.gantry-framework.org\" class=\"readon\">More Information</a>\r\n</div>', 1, 'showcase-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 0, '{\"prepare_content\":\"1\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"promo\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(89, 80, 'Feature Rich', '', '<h4 class=\"icon-asterisk\">&nbsp;Style Options</h4>\r\n<p>Dozens of style options are available for customization.</p>\r\n<h4 class=\"icon-asterisk\">&nbsp;Flexible Layout</h4>\r\n<p>Adjustable grid system for dynamic layouts.</p>\r\n<h4 class=\"icon-asterisk\">&nbsp;Networking &amp; Analytics</h4>\r\n<p>Integrate social networking and Google Analytics.</p>\r\n<p><a href=\"http://www.gantry-framework.org\" class=\"readon\">More Features</a></p>', 1, 'maintop-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":\"1\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(90, 0, 'Powerful Responsive Layout', '', '<p>A <strong>responsive</strong> layout adapts to the size of the viewing device, such as a desktop, smartphone or <strong>tablet</strong>, versus showing a separate layout.</p>\r\n\r\n<div class=\"gantry-width-50 gantry-width-block\">\r\n<p class=\"gantry-left\">\r\n    <strong class=\"icon-adjust\"> Five Modes:</strong> Responses for phones, tablets &amp; desktops.\r\n</p>\r\n<p class=\"gantry-left\">\r\n    <strong class=\"icon-external-link\"> Navigation:</strong> Basic select box menu system for smartphones.\r\n</p>\r\n</div>\r\n\r\n<div class=\"gantry-width-50 gantry-width-block\">\r\n	<p class=\"gantry-right hidden-phone\">\r\n		<strong class=\"icon-flag\"> Grid System:</strong> Responsive structure, up to 6 per row.\r\n	</p>\r\n<p class=\"gantry-right hidden-phone\">\r\n	<strong class=\"icon-print\"> Support Classes:</strong> Visible &amp; Hide classes for each response modes.\r\n</p>\r\n\r\n<p class=\"gantry-left visible-phone\">\r\n	<strong class=\"icon-flag\"> Grid System:</strong> Responsive structure, up to 6 per row.\r\n</p>\r\n<p class=\"gantry-left visible-phone\">\r\n	<strong class=\"icon-print\"> Support Classes:</strong> Visible &amp; Hide classes for each response modes.\r\n</p>\r\n</div>\r\n\r\n<div class=\"clear\"></div>\r\n\r\n<a href=\"http://www.gantry-framework.org\" class=\"readon\">Learn More</a>', 1, 'maintop-b', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":\"1\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(91, 81, 'Get Joomla! Support', '', '<p>If you need help with core Joomla features, you can <a href=\"http://www.cloudaccess.net/contacting-support.html\" target=\"_blank\">submit support tickets</a> or call our support team to get help with your site.</p>\r\n<p>We have a variety of <a href=\"http://www.cloudaccess.net/#pricing\" target=\"_blank\">hosting &amp; support plans</a> and our industry-leading support team is standing by to help you.&nbsp;</p>\r\n<p><a href=\"http://www.cloudaccess.net/cloudaccess-joomla-support/support-overview.html\" target=\"_blank\" class=\"readon\">Learn More</a></p>', 1, 'maintop-c', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":\"1\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"box3\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(92, 0, 'Main Menu', '', '', 5, 'sidebar-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_menu', 1, 1, '{\"menutype\":\"mainmenu\",\"startLevel\":\"1\",\"endLevel\":\"0\",\"showAllChildren\":\"0\",\"tag_id\":\"\",\"class_sfx\":\"\",\"window_open\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"hidden-phone nomarginbottom\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"itemid\"}', 0, '*'),
(93, 0, 'More Features', '', '<ul>\n    <li>\n        <strong>Built-in Features</strong><br />\n		<span>Examples include font-sizer, Google PrettyPrint, Google Analytics, to-top slider.</span>\n	</li>\n	<li>\n		<strong>4 Column Mainbody:</strong><br />\n		<span>Up to 3 total sidebars with each column\'s location being configurable.</span>\n	</li>\n	<li class=\"hidden-tablet hidden-phone\">\n		<strong>Flexible Parameters:</strong><br />\n		<span>Ability to set parameters via URL, Cookie, Session, Presets, etc.</span>\n	</li>\n</ul>\n\n<a href=\"http://www.gantry-framework.org/\" class=\"readon\">Read More</a>', 1, 'sidebar-b', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":\"1\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"box2\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(94, 0, 'Typography', '', 'Powerful <strong>typography</strong> from Bootstrap provides styling for tables, <strong>buttons</strong>, and other standard interface elements.', 1, 'footer-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":\"1\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"hidden-phone\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(95, 0, 'Ajax Base', '', 'Our <strong>AJAX</strong> system allows dynamic functionality in features as well as allowing AJAX for <strong>3rd party</strong> addons.', 1, 'footer-b', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":\"1\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"hidden-phone\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
(96, 0, 'Streamlined', '', '<strong>Gantry</strong> has an optimized codebase with speed, size, being the core tenets behind the <strong>framework</strong> design.', 1, 'footer-c', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":\"1\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"hidden-phone\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}', 0, '*'),
