(126, 68, 'User Friendly', '', '<div class=\"feature-img\" style=\"text-align: center;\">\r\n<div><em class=\"fa fa-user\"></em></div>\r\n</div>\r\n<h3 style=\"text-align: center;\">USER FRIENDLY</h3>\r\n<p style=\"text-align: center;\">With an intuitive user interface and beautiful design, the CloudBase 3 user interface ensures a great user experience.&nbsp;</p>\r\n<p style=\"text-align: center;\"><a href=\"#\" class=\"btn btn-primary\">Read more</a></p>', 1, 'feature-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(127, 69, 'Responsive Design', '', '<div class=\"feature-img\" style=\"text-align: center;\">\r\n<div><em class=\"fa fa-mobile\"></em></div>\r\n</div>\r\n<h3 style=\"text-align: center;\">RESPONSIVE DESIGN</h3>\r\n<p style=\"text-align: center;\">CloudBase 3 is designed to look great on any type of mobile device. Your content will look great on desktops, tablets and smartphones.&nbsp;</p>\r\n<p style=\"text-align: center;\"><a href=\"#\" class=\"btn btn-primary\">Read more</a></p>', 1, 'feature-b', 580, '2015-09-03 17:42:25', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(128, 70, 'Easily Customizable ', '', '<div class=\"feature-img\" style=\"text-align: center;\">\r\n<div><em class=\"fa fa-cogs\"></em></div>\r\n</div>\r\n<h3 style=\"text-align: center;\">EASILY CUSTOMIZABLE</h3>\r\n<p style=\"text-align: center;\">Packed with many administrative features, you can customize the CloudBase 3 to create the look and feel that you\'re after.&nbsp;</p>\r\n<p style=\"text-align: center;\"><a href=\"#\" class=\"btn btn-primary\">Read more</a></p>', 1, 'feature-c', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(129, 74, 'Showcase', '', '<div class=\"promo-desc\">\r\n<h1 style=\"font-weight: 200;\">Welcome to <strong>Your Website</strong></h1>\r\n<p>This is the frontpage of your new website hosted with CloudAccess.net<br />If you are new to Joomla, check out our FREE video tutorials!</p>\r\n<p><a href=\"http://www.cloudaccess.net/joomla-knowledgebase/138-joomla-3-1/getting-started.html\" target=\"_blank\" class=\"btn btn-default btn-large\">Free Getting Started Videos</a></p>\r\n</div>\r\n<div class=\"promo-image\"><img src=\"images/showcase-image.png\" alt=\"showcase-image\" /></div>', 1, 'showcase-a', 580, '2015-06-01 21:55:59', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"promo\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(130, 75, 'main features of cloudbase 3', '', '<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore</p>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore</p>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore</p>', 1, 'maintop-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(131, 76, 'About the Cloud Control Panel (CCP)', '', '<h2><img style=\"margin-right: 52px; float: left;\" src=\"images/cloudbase/cloud.png\" alt=\"cloud\" />About the Cloud Control Panel (CCP)</h2>\r\n<p>The Cloud Control Panel™ (CCP) is an innovative cloud application management tool enabling you to launch new applications, purchase domain names, submit support requests and manage each application hosted with CloudAccess.net. The CCP is a custom-built software at the heart of our platform and there isn\'t another control panel like in the hosting industry.</p>\r\n<p>The CCP offers a variety of features like the <a href=\"http://www.cloudaccess.net/cloud-control-panel-ccp/155-application-management/454-app-snapshot.html\" target=\"_blank\">App Snapshot</a> that you can use to create, manage and restore your site from a backup. There is also the <a href=\"http://www.cloudaccess.net/cloud-control-panel-ccp/155-application-management/747-replicate-site.html\" target=\"_blank\">Site Replication</a> feature that allows you to replicate the site in a staging area that you can use for testing and development. <a href=\"http://www.cloudaccess.net/products/cloud-control-panel.html\" target=\"_blank\">Learn more about the CCP</a>.&nbsp;</p>', 1, 'bottom-a', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(132, 77, 'Social Icons', '', '<ul>\r\n<li><a href=\"#\"><span class=\"icon-facebook-sign\"></span></a></li>\r\n<li><a href=\"#\"><span class=\"icon-twitter-sign\"></span></a></li>\r\n<li><a href=\"#\"><span class=\"icon-pinterest-sign\"></span></a></li>\r\n</ul>', 1, 'header-f', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 0, '{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"social-icons\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(133, 85, 'CloudAccess Admin Module', '', '<div class=\"row-fluid\">\r\n<div class=\"span3 text-center\"><img style=\"margin-bottom: 10px; margin-top: 5px; width: 65px;\" src=\"images/cloudbase/ccp.png\" alt=\"ccp\" />\r\n<p>Looking for a superior hosting platform? <br />Checkout the <a href=\"http://www.cloudaccess.net/products/cloud-control-panel.html\" target=\"_blank\">Cloud Control Panel (CCP)</a>.</p>\r\n<hr class=\"visible-phone\" /></div>\r\n<div class=\"span3 text-center\"><img style=\"margin-bottom: 10px; margin-top: 5px; width: 55px;\" src=\"images/cloudbase/support.png\" alt=\"support\" />\r\n<p>Need help with Joomla? The <a href=\"http://www.cloudaccess.net\" target=\"_blank\">CloudAccess.net</a> Support Team is standing by and ready to help you.<a href=\"http://www.cloudaccess.net/cloudaccess-joomla-support/support-overview.html\" target=\"_blank\"> Learn More.</a></p>\r\n<hr class=\"visible-phone\" /></div>\r\n<div class=\"span3 text-center\"><img style=\"margin-bottom: 10px; margin-top: 5px; width: 48px;\" src=\"images/cloudbase/video.png\" alt=\"video\" />\r\n<p>Gain instant access to free, easy-to-follow video tutorials for Joomla. Check out&nbsp;<a href=\"http://www.cloudaccess.net/joomla-knowledgebase/138-joomla-3-1/getting-started.html\" target=\"_blank\">Getting Started with Joomla</a>&nbsp;today!&nbsp;</p>\r\n<hr class=\"visible-phone\" /></div>\r\n<div class=\"span3 text-center\"><img style=\"margin-bottom: 10px; margin-top: 5px; width: 65px;\" src=\"images/cloudbase/webinar.png\" alt=\"webinar\" /></div>\r\n<div class=\"span3 text-center\">If you would like to submit a bug for the CloudBase 3 template, <a href=\"http://www.cloudaccess.net/cloudbase-3.html\" target=\"_blank\">go to the CloudBase 3 product page</a>.&nbsp;</div>\r\n</div>', 1, 'cpanel', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":\"1\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 1, '*');
