(7, 12, 'Watch a Joomla! Webinar', 'watch-a-joomla-webinar', 'http://www.cloudaccess.net/training/live-webinars.html', '<p>We\'ve got dozens of recorded webinars and we host free &amp; live webinars where you can post questions and get answers.&nbsp;</p>', 14, 1, 0, '0000-00-00 00:00:00', 4, 1, '{\"target\":\"\",\"width\":\"\",\"height\":\"\",\"count_clicks\":\"\"}', '*', '2014-11-20 18:53:41', 570, '', '2014-11-20 19:02:30', 570, '', '', '{\"robots\":\"\",\"rights\":\"\"}', 0, '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, '{\"image_first\":\"\",\"float_first\":\"\",\"image_first_alt\":\"\",\"image_first_caption\":\"\",\"image_second\":\"\",\"float_second\":\"\",\"image_second_alt\":\"\",\"image_second_caption\":\"\"}'),
